import React from "react";
import videoIcon from "../../assets/icons/video-library-dash.png";

const recentlyAdded = ({ videos }) => {
  return (
    <div className="container dashOpacity mb-5">
      <div id="video-wrapper" className="card mb-1 pb-3">
        <div className="mt-4">
          <img id="rec-videos-icon" src={videoIcon} alt="" />
          <h4 className="card-title fs-3">Recently Added Videos</h4>
          <h6 className="card-subtitle mb-3 text-black-50">
            Updated on March 2nd
          </h6>
        </div>
        <div className="video-container">
          {videos.map((video, i) => (
            <div key={i} className="video">
              <iframe
                width="100%"
                height="280"
                src={`https://www.youtube.com/embed/${video.resourceId.videoId}`}
                frameBorder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
              ></iframe>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default recentlyAdded;
